import React from 'react'
import { useState } from 'react'


export const YoutubeSubscription = () => {

    const [message, setMessage] = useState("Welcome to RK Foundation")
    const [buttonMessage, setbuttonMessage] = useState("Subscribe")

    const subscribeFunction = () =>
    {
        if(buttonMessage == "subscribe")
        {
        setMessage("Yes you are subscribed!")
        setbuttonMessage("Unsubscribe")
        }
    }

    return (

        <React.Fragment>
            <h1>{message}</h1>

            <button onClick={subscribeFunction}>{buttonMessage}</button>

        </React.Fragment>
    )
}
